import { useState } from "react";

const Form = () => {

    const [user, setUser] = useState

    return(
        <form>

            <label htmlFor="username">username</label>
            <input type="text" />

            <label htmlFor="password">password</label>
            <input type="text" />

            <button>Login</button>

        </form>
    )

}

export default Form;
